import React from 'react';
import Header from '../Framework/Header/Header';
//import { DataBuilder } from '../pages/DataBuilder/DataBuilder';
import Wrapper from '../utils/Wrapper';
//import classes from './Layout.module.css';

//Layout function component
const Layout = ({ history,children }: { history?: History,children:any },) => {
    const [headerName,setHeaderName] = React.useState("Postcode finder");
    return (
        <Wrapper>
            {<Header headerName= {headerName}/>}
            {React.cloneElement(children, { history })}
        </Wrapper>
    );

};
export default Layout;
